import './App.css';
import { useState } from 'react'

function App() {

  // Setting state for location list
  const [locations, setLocations] = useState([
      {
        id: 1,
        name: 'Seattle',
        lat: '47.6038321',
        lon: '-122.3300624'
      }
    ])


  return (
    <div className="App">
      <header className="App-header">
        <h1>Find your Location!</h1>

      </header>
    </div>
  );
}

export default App;
